        function calcCriticalZ(n, N, w0) {
            return sig_crit.map((s, i) => {
                const w = expectedWealth(s, k_crit[i], n, N, w0);
                return Math.log10(Math.max(w, 1e-10));
            });
        }

        function calcAlphaContourZ(alphaVal, n, N, w0) {
            const data = alphaContours[alphaVal];
            if (!data) return [];
            return data.sigma.map((s, i) => {
                const w = expectedWealth(s, data.k_th[i], n, N, w0);
                return Math.log10(Math.max(w, 1e-10));
            });
        }

                if (alphaContours[alpha]) {
                    zUpdates.push(calcAlphaContourZ(alpha, currentN, currentParticipants, currentW0));
                }
            }

            // Vertical planes (unchanged)
            zUpdates.push(Z_PLANE);
            zUpdates.push(Z_PLANE);

            Plotly.restyle('plot', {'z': zUpdates});
